import React, { useState } from 'react';
import { View, Text, StyleSheet, ScrollView, TouchableHighlight, TouchableOpacity } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';
import { useNavigation } from '@react-navigation/native';
import { useCart } from '../../CartContext'; 

export default function Seller() {
  const navigation = useNavigation();
  const { cartItems, addToCart, removeFromCart } = useCart(); 

  const menuItems = [ 
    { name: 'Italian BMT', price: '$6111.99' },
    { name: 'Chicken Teriyaki', price: '$7.49' }, 
    { name: 'Veggie Delite', price: '$5.99' }, 
  ];
  const [pressedMenuItem, setPressedMenuItem] = useState(null);

  const toggleSCartIcon = () => {
    navigation.navigate('SCartIcon');
  };

  return (
    <View style={styles.container}>
      <TouchableOpacity
        onPress={() => navigation.goBack()}
        style={styles.backButton}
      >
        <Icon name="arrow-left" size={24} color="black" />
      </TouchableOpacity>
      
      <Text style={styles.sectionTitle}>Subway Menu</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: 19,
    paddingHorizontal: 20,
    justifyContent: 'center',
  },
  sectionTitle: {
    fontSize: 24,
    fontWeight: 'bold',
    marginTop: 10,
  },
});
